y which can be used to format returned prices.'=>'Oddeľovač tisíc pre menu, ktorá bude použitá na formát vrátených cien.','The ID of the payment method being used to process the payment.'=>'ID použitej metódy platby počas zaplatenia.','Result of payment processing, or false if not yet processed.'=>'Výsledok spracovania platby. Alebo hodnota false, ak ešte nebola spracovaná.','Min and max prices found in collection of products, provided using the smallest unit of the currency.'=>'Minimálne a maximálne ceny nájdené v zbierke produktov, poskytované prostredníctvom najmenšej jednotky meny.','Decimal separator for the currency which can be used to format returned prices.'=>'Oddeľovač desatinných miest meny, ktorú je možné použiť na naformátovanie vrátených cien.','Total price of items in the cart.'=>'Celková suma položiek v košíku.','Total price of any applied fees.'=>'Celková suma všetkých použitých poplatkov.','Total tax on fees.'=>'Celková daň z poplatkov.','Total price of shipping.'=>'Celková cena za dopravu.','Total price the customer will pay.'=>'Celková cena, ktorú zákazník zaplatí.','A URL to redirect the customer after checkout. This could be, for example, a link to the payment processors website.'=>'URL adresa, kam má byť zákazník presmerovaný z pokladne. Napríklad, odkaz na webstránku spracovania platby.','The amount of tax charged.'=>'Výška zaúčtovanej dane.','Category image.'=>'Obrázok kategórie.','Number of reviews for products in this category.'=>'Počet recenzií produktov v tejto kategórií.','Error code'=>'Kód chyby','Status of the payment returned by the gateway. One of success, pending, failure, error.'=>'Stav platby vrátený platobnou bránou. Jedna z fráz "úspešná, spracuje sa, zlyhala, chyba".','Current set shipping address for the customer.'=>'Aktuálna nastavená dodacia adresa zákazníka.','List of available shipping rates for the cart.'=>'Zoznam dostupných prepravných sadzieb v košíku.','Cart total amounts provided using the smallest unit of the currency.'=>'Celkové sumy košíka za použitia najmenšej jednotky meny.','Lines of taxes applied to items and shipping.'=>'Daňové riadky uplatňené pre zásielky a dopravu.','An array of data being returned from the payment gateway.'=>'Spätné údaje, ktoré sa vracajú z platobných brán.','Currency minor unit (number of digits after the decimal separator) for returned prices.'=>'Hlavná jednotka meny (počet číslic za desatinným oddeľovačom) pre vrátené ceny.','Total discount from applied coupons.'=>'Sumár zliav získaných cez zľavový kód.','Total tax removed due to discount from applied coupons.'=>'Sumár dane bol odstránený kvôli zľave zo zľavového kódu.','List of applied cart coupons.'=>'Zoznam použitých zľavových kódov v košíku.','True if the cart needs payment. False for carts with only free products and no shipping costs.'=>'Hodnota true, ak košík vyžaduje platbu. Hodnota false pre košíky s produktami zadarmo a bezplatnou dopravou.','Country/Region code in ISO 3166-1 alpha-2 format.'=>'Kód krajiny/regiónu vo fomáte ISO 3166-1 alpha-2.','The coupons unique code.'=>'Unikátne kódy kupónov.','Total discount applied by this coupon.'=>'Celková zľava použitá týmto kupónom.','Apartment, suite, etc.'=>'Dom, byt, atď.','State/County code, or name of the state, county, province, or district.'=>'Kód štátu/krajiny alebo názov štátu, kraja, provincie alebo okresu.','Returns number of products within attribute terms.'=>'Vráti počet produktov v rámci podmienky atribútu.','Total tax removed due to discount applied by this coupon.'=>'Celková daň odstránená použitím zľavy tohto kupóna.','%1$s requires an instance of %2$s or %3$s for the address'=>'%1$s vyžaduje inštanciu z %2$s alebo %3$s pre adresu','Total amounts provided using the smallest unit of the currency.'=>'Celkové suma poskytnutá pomocou najmenšej jednotky meny.','List of cart item errors, for example, items in the cart which are out of stock.'=>'Zoznam chýbných položiek v košíku. Napríklad tie položky, ktoré nie sú na sklade.','Note 