oupons menu item.'=>'Zľavové kódy je možné spravovať z Marketing > Zľavové kódy. Kliknutím na tlačidlo nižšie odstránite starú položku WooCommerce > Zľavové kódy z menu.','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s database?'=>'Vytvorenie tabuľky WooCommerce %1$s zlyhalo. Má používateľ %2$s práva VYTVÁRAŤ tabuľky v databáze %3$s?','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Ak je váš obchod na územi EU, odporúčame použiť rozšírenie pre VAT(DPH) číslo, pre pridanie aumatických sazieb. Pridá to pole do košíka, pre zber a overenie zákazníkovho VAT čísla, ak ho majú.','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Získajte oznámenia o aktivite v obchode, vrátane nových objednávok a hodnotení produktov priamo vo vašom mobilnom zariadení s aplikáciou Woo.','Verifying database... One or more tables are still missing: '=>'Overujem databázu... Jedna alebo viac tabuliek stále chýba:','Verify base database tables'=>'Overiť tabuľky základnej databázy','Verify if all base database tables are present.'=>'Skontrolovať, či sú k aktuálne všetky základné databázové tabuľky.','This tool will empty the template cache.'=>'Tento nástroj vyprázdni vyrovnávaciu pamäť témy.','Maximum number of items to be returned in result set. Defaults to no limit if left blank.'=>'Maximálny počet položiek, ktoré budú tvoriť sadu. Predvolené hodnoty bez obmedzenia, ak zostane pole prázdne.','Collect and validate EU VAT numbers at checkout'=>'Zbierať a potvrdzovať čísla EU VAT v pokladni','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'Spustenie webovej stránky s módou je vzrušujúce, ale môže to byť ešte ohromujúcejšie. V tomto článku vás prevedieme procesom spustenia, naučímae vás vytvárať úspešné zoznamy produktov, a ešte vám ukážeme, ako predávať vášmu ideálnemu publiku.','Start your online clothing store'=>'Začnite s vaším online obchodom s oblečením','Coupon management has moved!'=>'Správa kupónov sa presunula!','The admin note layout has a wrong prop value.'=>'Šablóna poznámky administrátora má nesprávnu prop hodnotu.','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Tento video návod vám pomôže prejsť procesom pridávania prvého produktu vo WooCommerce.','Do you need help with adding your first product?'=>'Potrebujete pomôcť s pridaním vášho prvého produktu?','Share feedback'=>'Zdieľať spätnú väzbu','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.'=>'Teraz keď ste si nás vybrali ako partnera, naším cieľom je sa uistiť, že vám zabezpečujeme správne nástroje ktoré potrebujete. Čakáme na vaše pripomienky týkajúce sa nastavenia obchodu, aby sme ich mohli v budúcnosti zlepšiť.','Watch tutorial'=>'Prezrieť si tutoriál','Changing eCommerce platforms might seem like a big hurdle to overcome, but it is easier than you might think to move your products, customers, and orders to WooCommerce. This article will help you with going through this process.'=>'Zmena ecommerce systému sa môže zdať ako veľká prekážka, ale je to jednoduchšie než si myslíte presunúť vaše produkty, zákazníkov a aj objednávky do WooCommerce. Tento článok vám pomôže s týmto procesom prechodu.','Do you want to migrate from Shopify to WooCommerce?'=>'Chcete migrovať zo systému Shopify na WooCommerce?','WooCommerce Subscriptions allows you to introduce a variety of