 hit the 10 orders milestone! Look at you go. Browse some WooCommerce success stories for inspiration.'=>'Dosiahli ste medzník 10 objednávok! Pozrite sa na to. Prezrite si niektoré príbehy o úspechu WooCommerce pre inšpiráciu.','Congratulations on processing %s orders!'=>'Gratulujeme k spracovaniu %s objednávok!','Woohoo, %1$s was your record day for sales! Net sales was %2$s beating the previous record of %3$s set on %4$s.'=>'Woohoo, %1$s tento deň prekonal rekord v predajnosti! Čistý predaj bol %2$s a prekonal predchádzajúci rekord %3$s  z %4$s.','Activate usage tracking'=>'Aktivujte sledovanie používania','Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the %1$sSettings%3$s and choose to stop sharing data. %2$sRead more%3$s about what data we collect.'=>'Zhromažďovanie údajov o používaní nám umožňuje vylepšiť WooCommerce. Váš obchod sa bude posudzovať, pri vyhodnocovaní nových funkcií, posudzovaní kvality aktualizácie, alebo určovaní, či má nejaké vylepšenie zmysel. Vždy môžete navštíviť %1$sNastavenia%3$s a zvoliť zastavenie zdieľania údajov. %2$sČítajte viac%3$s o tom, aké údaje zhromažďujeme.','Review'=>'Recenzia','Congratulations on getting your first order! Now is a great time to learn how to manage your orders.'=>'Gratulujeme k získaniu vašej prvej objednávky! Teraz je skvelý čas, aby ste sa naučili spravovať objednávky.','Add a product'=>'Pridať produkt','Add your first product'=>'Pridajte prvý produkt','Report table data is being deleted.'=>'Údaje tabuľky prehľadov sa odstraňujú.','Report table data is being rebuilt. Please allow some time for data to fully populate.'=>'Údaje tabuľky prehľadov sa obnovujú. Počkajte, kým sa údaje úplne nenaplnia.','An import is already in progress. Please allow the previous import to complete before beginning a new one.'=>'Import už prebieha. Predtým, ako začnete