\Internal\\Admin\\Schedulers\\ImportScheduler class.','Database error.'=>'Chyba databázy.','Unknown status found for action.'=>'Neznámy stav pre túto akciu.','Invalid value for select or count parameter. Cannot query actions.'=>'Neplatná hodnota pre parameter select alebo count. Nemožno dopytovať akcie.','Activity log for the action.'=>'Log aktivity pre túto akciu.','Stopped the insanity for %d second'=>'Dajte si prestávku na %d sekundu' . "\0" . 'Dajte si prestávku na %d sekundy' . "\0" . 'Dajte si prestávku na %d sekúnd','Settings for WooCommerce admin reporting.'=>'Nastavenia pre WooCommerce hlásenia správcov.','%1$s &lsaquo; %2$s'=>'%1$s &lsaquo; %2$s','%s Support for strings longer than this will be removed in a future version.'=>'%s Podpora reťazcov dlhších ako tento bude odstránená v budúcej verzii.','ActionScheduler_Action::$args too long. To ensure the args column can be indexed, action args should not be more than %d characters when encoded as JSON.'=>'ActionScheduler_Action::$args too long. Aby sa zabezpečilo, že stĺpec args sa dá indexovať, nemali by mať action args, keď sú kódované ako JSON, viac ako %d znakov.','There was a failure scheduling the next instance of this action: %s'=>'Pri plánovaní ďalšej inštancie tejto akcie sa vyskytla chyba: %s','There was a failure fetching this action: %s'=>'Pri načítaní tejto akcie sa vyskytla chyba: %s','action ignored via %s'=>'akcia ignorovaná pomocou %s','action failed via %1$s: %2$s'=>'akcia zlyhala cez %1$s: %2$s','action complete via %s'=>'akcia dokončená pomocou %s','action started via %s'=>'akcia sa začala prostredníctvom %s','The next queue will begin processing in approximately %d seconds.'=>'Ďalšia fronta sa začne spracovávať približne za %d sekúnd.','A new queue has begun processing. <a href="%s">View actions in-progress &raquo;</a>'=>'Začala sa spracovávať nová fronta. <a href="%s">Zobraziť prebiehajúce akcie &raquo;</a>','Action [%1$s] has an invalid schedule: %2$s'=>'Akcia [%1$s] má neplatný rozvrh: %2$s','Excluded report order statuses'=>'Vylúčené stavy objednávok','The date/time the action is/was scheduled to run.'=>'Dátum/čas, kedy sa má/malo naplánovať spustenie akcie.','The action\'s schedule frequency.'=>'Frekvencia plánovania akcie.','Optional action group.'=>'Nepovinná skupina akcie.','Optional data array passed to the action hook.'=>'Optional data array passed to the action hook.','Action statuses are Pending, Complete, Canceled, Failed'=>'Stavy akcií sú Spracováva sa, Vybavená, Zrušená, Neúspešná','Name of the action hook that will be triggered.'=>'Názov action hooku, ktorý sa spustí.','Scheduled Action Columns'=>'Naplánované stĺpce akcií','Action Scheduler is a scalable, traceable job queue for background processing large sets of actions. Action Scheduler works by triggering an action hook to run at some time in the future. Scheduled actions can also be scheduled to run on a recurring schedule.'=>'Action Scheduler (Plánovač akcií) je škálovateľný sledovateľný zoznam úloh na spracovanie veľkých súborov akcií na pozadí. Plánovač akcií funguje tak, že v budúcnosti spustí akciu. Akcie môžu byť naplánované tak, aby sa spúšťali podľa opakujúceho sa plánu.','Scheduled'=>'Naplánované','About Action Scheduler %s'=>'O Action Scheduler %s','Action Scheduler migration in progress. The list of scheduled actions may be incomplete.'=>'Prebieha migrácia nástroja Action Scheduler. Zoznam plánovaných akcií môže byť neúplný.','About'=>'O nás','Migrated action with ID %1$d in %2$s to ID %3$d in %4$s'=>'Migrovaná akcia s ID %1$d za %2$s pre ID %3$d za %4$s','Migrating %d action'=>'Migrácia %d akcie' . "\0" . 'Migrácia %d akcií' . "\0" . 'Migrácia %d akcií','Unable to remove source migrated action %s'=>'Nie je možné odstrániť akciu migrácie zdroja %s','Version:'=>'Verzia:','Filename'=>'Názov súboru','Redirect only (Insecure)'=>'Iba presmerovanie (nezabezpečené)','If you are using X-Accel-Redirect download method along with NGINX server, make sure that you have applied settings as described in <a href=\'%s\'>Digital/Downloadable Product Handling</a> guide.'=>'Ak používate metódu sťahovania X-Accel-Redirect spolu so serverom NGINX, uistite sa, že ste použili nastavenia opísané v príručke <a href=\'%s\'> Manipulácia s digitálnymi / stiahnuteľnými produktami </a>.','MaxMind Geolocation'=>'Geolokácia MaxMind','Choose countries / regions&hellip;'=>'Vyberte krajiny / regióny&amp;hellip;','Not required if your download directory is protected. <a href=\'%s\'>See this guide</a> for more details. Files already uploaded will not be affected.'=>'Nevyžaduje sa, ak je adresár na stiahnutie chránený. <a href=\'%s\'>Viac informácií nájdete v tejto príručke</a>. Na už odovzdané súbory to nebude mať vplyv.','Choose a country / region&hellip;'=>'Vyberte krajinu / región&hellip;','Update country / region'=>'Aktualizujte krajinu / región','Items Subtotal:'=>'Medzisúčet položiek:','Coupon(s):'=>'Kupón(y):','Fees:'=>'Poplatky:','Append a unique string to filename for security'=>'Z dôvodu bezpečnosti pripojte k názvu súboru jedinečný reťazec','Action Scheduler package'=>'Action Scheduler balík','Action Scheduler has migrated data to custom tables; however, orphaned log entries exist in the WordPress Comments table. %1$s <a href="%2$s">Learn more &raquo;</a>'=>'Action Scheduler zmigroval údaje do vlastných tabuliek; Osamotené položky denníka však existujú v tabuľke WordPress Comments. %1$s <a href="%2$s">Zistite viac &raquo;</a>','Action Scheduler package running on your site.'=>'Action Scheduler balík beží na vašej stránke.','Unable to detect the Action Scheduler package.'=>'Balíček Action Scheduler sa nepodarilo zistiť.','Invalid action - must be a recurring action.'=>'Neplatná akcia - musí to byť opakujúca sa akcia.','Destination logger must be configured before running a migration'=>'Cieľový záznam musí byť nakonfigurovaný pred spustením migrácie','Destination store must be configured before running a migration'=>'Cieľový obchod musí byť nakonfigurovaný