ve enough "%1$s" in stock to fulfill your order (%2$s available). We apologize for any inconvenience caused.'=>'Ospravedlňujeme sa, nemáme dostatok &bdquo;%1$s&ldquo; na sklade aby sme mohli naplniť vašu objednávku (k dispozícii je: %2$s). Ospravedlňujeme sa za spôsobené problémy.','View affected templates'=>'Zobraziť dotknuté šablóny','Thanks for shopping with us'=>'Vďaka, že nakupujete u nás','Variation status.'=>'Stav variácie.','Status of the review.'=>'Stav hodnotenia.','Cannot create existing product review.'=>'Nemožno vytvoriť hodnotenie existujúceho produktu.','Update your theme to the latest version. If no update is available contact your theme author asking about compatibility with the current WooCommerce version.'=>'Aktualizujte vašu tému na najnovšiu verziu. Ak nie je k dispozícii žiadna aktualizácia, požiadajte autora témy. aby zabezpečil kompatibilitu s aktuálnou verziou WooCommerce.','Avatar URLs for the object reviewer.'=>'URL adresa avatara pre recenzenta objektov.','Limit result set to reviews assigned to specific user IDs.'=>'Obmedziť výsledok na recenzie priradené konkrétnym ID používateľov.','Ensure result set excludes reviews assigned to specific user IDs.'=>'Zabezpečí, aby množina výsledkov neobsahovala recenzie priradené konkrétnym ID používateľov.','Avatar URL with image size of %d pixels.'=>'Adresa URL avataru s veľkosťou obrázka %d pixlov.','If you copied over a template file to change something, then you will need to copy the new version of the template and apply your changes again.'=>'Ak ste skopírovali súbor šablóny, aby ste niečo zmenili, budete musieť skopírovať novú verziu šablóny a znova aplikovať zmeny.','Limit response to resources created after a given ISO8601 compliant date.'=>'Obmedzte odpovede na zdroje vytvorené po danom dátume kompatibilnom s normou ISO8601.','Limit response to reviews published before a given ISO8601 compliant date.'=>'Obmedzte odpovede na recenzie uverejnené pred daným dátumom vyhovujúcim norme ISO8601.','