_blank">dokumentácii</a> k prepravným zónam.','Completed'=>'Vybavená','Change status to completed'=>'Zmeniť stav na vybavená','Change status to processing'=>'Zmeniť stav na spracováva sa','Create your first coupon'=>'Vytvorte váš prvý kupón','Change status: '=>'Zmeniť stav:','Payment via'=>'Platba cez','%s = human-readable time difference%s ago'=>'Pred %s','M j, Y'=>'M j, Y','Existing products that match by ID or SKU will be updated. Products that do not exist will be skipped.'=>'Existujúce produkty s vyhovujúcim ID alebo SKU budú aktualizované. Nenájdené produkty budú preskočené.','To receive updates and support for this extension, you need to <strong>purchase</strong> a new subscription or consolidate your extensions to one connected account by <strong><a href="%1$s" title="Sharing Docs">sharing</a> or <a href="%2$s" title="Transferring Docs">transferring</a></strong> this extension to this connected account.'=>'Pre získanie aktualizácií a podpory pre toto rozšírenie si musíte <strong>zakúpiť</strong> nové predplatné alebo spojiť vaše rozšírenia do jednoho prepojeného účtu pomocou <strong><a href="%1$s" title="Dokumentácia zdieľania">zdieľania</a> alebo <a href="%2$s" title="Dokumentácia presunu">presunutia</a></strong> rozšírenia do tohto prepojeného účtu.','On-hold'=>'Čaká na platbu','Change status to on-hold'=>'Zmeniť stav na čaká na platbu','The WooCommerce Helper plugin is no longer needed. <a href="%s">Manage subscriptions</a> from the extensions tab instead.'=>'Plugin WooCommerce Helper už nepotrebujete. Namiesto neho <a href="%s">spravujte predplatné</a> z možností rozšírení.','Delete "%s" permanently'=>'Zmazať "%s" navždy','payment setup'=>'nastavenie platby','Continue with Jetpack'=>'Pokračovať s Jetpackom','Webhook topic unknown. Please select a valid topic.'=>'Neznáma webhook téma. Vyberte platnú tému.','payment setup and automated taxes'=>'nastavenie platby a automatizovaných daní','Reasons you\'ll love Jetpack'=>'Dôvody, prečo budete mať radi Jetpack','Email address to receive payments'=>'Emailová adresa na prijímanie platieb','Direct payments to email address:'=>'Priama platba na e-mailovú adresu:','Choose the payment that you want, pay now, pay later or slice it. No credit card numbers, no passwords, no worries. <a href="%s" target="_blank">Learn more about Klarna</a>.'=>'Vyberte platbu, ktorú chcete, zaplaťte teraz, neskôr alebo rozdeľte platbu. Žiadne čísla kreditných kariet, žiadne heslá, žiadne starosti. <a href="%s" target="_blank">Získajte viac info o Klarna</a>.','Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell online and in store and track sales and inventory in one place. <a href="%s" target="_blank">Learn more about Square</a>.'=>'Bezpečný príjem kreditných a debetných kariet s jednotnou nízkou sadzbou, bez nečakaných poplatkov (možnosť vlastných sadzieb). Predávajte online aj fyzicky v  obchode a merajte predaje a zásoby na jednom mieste. <a href="%s" target="_blank">Získajte viac info o Square</a>.','Klarna Payments'=>'Spôsob platby Klarna','Klarna Checkout'=>'Klarna pokladňa','Square'=>'Square','Revision restored.'=>'Revízia bola obnovená.','Accept debit and credit cards in 135+ currencies, methods such as Alipay, and one-touch checkout with Apple Pay. <a href="%s" target="_blank">Learn more</a>.'=>'Akceptuje debetné a kreditné karty v 135+ menách, tiež spôsoby platby ako sú Alipay a Apple Pay. <a href="%s" target="_blank">Zistite viac</a>.','If you like, you may enter custom structures for your product URLs here. For example, using <code>shop</code> would make your product links like <code>%sshop/sample-product/</code>. This setting affects product URLs only, not things such as product categories.'=>'Ak chcete, môžete upraviť štruktúru URL adries produktov. Napríklad, použitím <code>shop</code> zmeníte odkazy produktu na <code>%sshop/sample-product/</code>. Toto nastavenie ovplyvní iba URL adresy produktov a nič iné.','I will also be sel