okročilý systém ochrany pre PHP inštalácie. Bol navrhnutý tak, aby na jednej strane chránil vaše servery proti celej škále známych problémov s PHP aplikáciami a na druhej strane proti možným neznámym chybám, ktoré sa nachádzajú v týchto aplikáciách, prípadne v samotnom jadre PHP. Ak Suhosin na svojom serveri povolíte, zrejme ho bude nutné nakonfigurovať a zvýšiť jeho limity odosielania dát.','A list of taxonomy terms that can be used in regard to order/product statuses.'=>'Zoznam výrazov taxonómie, ktoré sa môžu použiť vo vzťahu k stavom objednávky/produktu.','GZip (gzopen) is used to open the GEOIP database from MaxMind.'=>'Funkcia GZip (gzopen) sa používa na otvorenie databázy GEOIP od spoločnosti MaxMind.','Some webservices like shipping use SOAP to get information from remote servers, for example, live shipping quotes from FedEx require SOAP to be installed.'=>'Niektoré webové služby, ako napríklad preprava, používajú protokol SOAP na získanie informácií zo vzdialených serverov. Napríklad cenové ponuky v reálnom čase od spoločnosti FedEx vyžadujú, aby bol protokol SOAP nainštalovaný.','HTML/Multipart emails use DOMDocument to generate inline CSS in templates.'=>'Emaily vo formáte HTML/Multipart používajú triedu DOMDocument na vygenerovanie inline CSS štýlov v šablónach.','Catalog &amp; search'=>'Katalóg a vyhľadávanie','Your server does not have the %s class enabled - HTML/Multipart emails, and also some extensions, will not work without DOMDocument.'=>'Na vašom serveri nie je aktivovaná trieda %s. Bez nej nebudú fungovať emailové správy typu HTML/Multipart a ani niektoré rozšírenia.','Active plugins.'=>'Aktívne pluginy.','MySQL version.'=>'Verzia MySQL.','Max upload size.'=>'Maximálna veľkosť nahratého súboru.','PHP version.'=>'Verzia PHP.','Server info.'=>'Server info.','Parent theme author URL.'=>'URL adresa nadradenej témy.','WC database version.'=>'Verzia databázy WooCommerce.','Parent theme version.'=>'Verzia parent témy','Copy for support'=>'Kopírovať pre